#!/bin/bash

if [ -z $1 ]; then 
	let "state = 1" #both actions
elif [ $1 = "--build" ]; then
	let "state = 0" #just build
elif [ $1 = "--install" ]; then
	let "state = 2" #just install
else 
	echo "invalid flags"
fi

echo "Dialogc INSTALL script"
echo 
echo "Script will extract a tarball and build from its contents. You will then be prompted for a folder to install into."
echo "In this folder, bin and lib folders will be created."
echo "Continue? (y/n)"

read userin

if [ $userin != "y" ]; then #user confirmation
	echo "exit"
	exit
fi

#build
if (( $state <= 1 )); then
	echo "Extracting..."
	uudecode $0
	tar -xvf dialogc.tar > /dev/null
	echo "Compiling..."
	cp include/y.tab.h src/yadc/
	make
	echo "Tidying..."
	make clean
	rm dialogc.tar
fi
#end build


#install
if (( $state >= 1 )); then
	echo
	echo
	echo "Enter an install path:"
	read instlpath

	if [ ! -d $instlpath ]; then 
		echo "Directory does not exist; create it?"
		read userin
		if [ $userin == "y" ]; then #user confirmation
			mkdir -p $instlpath
		else
			echo "Installation not possible, exiting."
			exit
		fi
	fi

	echo "Making directories..."
	mkdir $instlpath/dat $instlpath/bin $instlpath/lib
	echo "Populating..."
	cp lib/libcompiler.so $instlpath/lib
	cp bin/* $instlpath/bin
	cp -rf dat/* $instlpath/dat
	cp README $instlpath/README

	#adding LD_PATH to .bashrc
	echo
	echo ".bashrc is being changed to include a command to run at start up that will allow Dialogc to run."
	echo "The command being added is export LD_LIBRARY_PATH={LD_LIBRARY_PATH}:../lib/"
	echo "Continue? (y/n)"

	read userin

	if [ $userin != "y" ]; then #user confirmation
		echo "exit"
		exit
	fi
	echo "export LD_LIBRARY_PATH={LD_LIBRARY_PATH}:../lib/" >> ~/.bashrc
	source ~/.bashrc
	#end .bashrc
fi
#end install

exit




